import React, {FC, InputHTMLAttributes} from "react";

interface InputProps extends InputHTMLAttributes<HTMLInputElement> {
    type: string;
    name: string;
    value: string;
    placeholder: string;
    onChange: any;
}

const Input: FC<InputProps> = ({type, value, name, placeholder, onClick}) => {
    return (
        <input type={type} value={value} name={name} placeholder={placeholder} onClick={onClick}/>
    )
}

export default Input;
